import './App.css';
import React, { Component } from "react";
import FilteredList from './FilteredList';

const songs = [
  {title: "HIP", language: "Korean", artist: "MAMAMOO", singer: "Female", duration: 195},
  {title: "TOP", language: "Korean", artist: "Stray Kids", singer: "Male"},
  {title: "Blueming", language: "Korean", artist: "IU", singer: "Female"},
  {title: "Wake Me Up", language: "English", artist: "Avicii", singer: "Male"},
  {title: "Rather Be", language: "English", artist: "Clean Bandit", singer: "Female"},
  {title: "Flamingo", language: "Japanese", artist: "Yonezu Kenshi", singer: "Male"},
  {title: "BL", language: "Japanese", artist: "Queen Bee", singer: "Other"},
  {title: "Night Diver", language: "Japanese", artist: "Miura Haruma", singer: "Male"},
  {title: "Ready Steady", language: "Japanese", artist: "Giga", singer: "Other"},
  {title: "Sunflower", language: "Japanese", artist: "Orangestar", singer: "Female"},
  {title: "Nocturne", language: "Chinese", artist: "Jay Chou", singer: "Male"},
  {title: "Super star", language: "Chinese", artist: "SHE", singer: "Female"}
];

export default class App extends React.Component{
  constructor(props){
    super(props);
  }

  render(){
    return(
      <div>
        <h1>Music Playlist</h1>
        <div><FilteredList list = {songs} /></div>
      </div>
    )
  }
}
